{"post_stream":{"posts":[{"id":3546804,"name":"","username":"daniel3","avatar_template":"/letter_avatar_proxy/v4/letter/d/a4c791/{size}.png","created_at":"2025-03-04T01:26:03.347Z","cooked":"<p>Hello!<br>
We are implementing this year pathfinding to go from one point to other, but we are facing an issue with that.</p>
<p>Pathfinding work very well and precisely and we are using a Joystick button to run it, like this.</p>
<pre><code class="lang-auto">new JoystickButton(Joystick1, OIConstants.kCollectCoralLeftButtonIdx).whileTrue(FieldPoses.kCoralLeftPose, AutoConstants.constraints));
</code></pre>
<p>It works good, however the problem start when we try to use the same button to go to diferrent poses, for example we did some logic to find the nearest coral station pathfinding to It.</p>
<pre><code class="lang-auto"> public Pose2d getCollectPose() {
        Pose2d currentPose = swerveSubsystem.getPoseEstimator();
        Translation2d currentTranslation = currentPose.getTranslation();

        double distanceToLeft = currentTranslation.getDistance(FieldPoses.kCoralBlueLeft.getTranslation());
        double distanceToRight = currentTranslation.getDistance(FieldPoses.kCoralBlueRight.getTranslation());

        if (distanceToLeft &lt; distanceToRight) {
            System.out.println("Left!");
            return FieldPoses.kCoralBlueLeft;
        } else {
            System.out.println("Right!");
            return FieldPoses.kCoralBlueRight;
        }}
</code></pre>
<p>And after we have the target pose we use this in the button.</p>
<pre><code class="lang-auto">new JoystickButton(Joystick1, OIConstants.kCollectCoralLeftButtonIdx).whileTrue(AutoBuilder.pathfindToPose(getCollectPose(), AutoConstants.constraints));
</code></pre>
<p>the problem here is that it always go to one position, and we put some prints to check if the command was running and It do no print nothing, It just print once when the robot start. Should we use a Supplier or something like that to fix this issue, It looks that the getCollectPose is not been used all the times that we press the button</p>","post_number":1,"post_type":1,"posts_count":4,"updated_at":"2025-03-04T01:26:03.347Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":6,"reads":77,"readers_count":76,"score":60.4,"yours":false,"topic_id":494127,"topic_slug":"pathplanner-pathfinding-to-different-positions-with-the-same-button","display_username":"","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[{"id":2,"count":1}],"moderator":false,"admin":false,"staff":false,"user_id":73610,"hidden":false,"trust_level":1,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"post_url":"/t/pathplanner-pathfinding-to-different-positions-with-the-same-button/494127/1","custom_user_title":null,"reactions":[{"id":"heart","type":"emoji","count":1}],"current_user_reaction":null,"reaction_users_count":1,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null,"can_vote":false},{"id":3546984,"name":"","username":"TheBatman","avatar_template":"/user_avatar/www.chiefdelphi.com/thebatman/{size}/255139_2.png","created_at":"2025-03-04T04:58:54.625Z","cooked":"<p>You should use a deffered command with the method being its command supplier</p>","post_number":2,"post_type":1,"posts_count":4,"updated_at":"2025-03-04T04:58:54.625Z","reply_count":0,"reply_to_post_number":null,"quote_count":0,"incoming_link_count":1,"reads":50,"readers_count":49,"score":15.0,"yours":false,"topic_id":494127,"topic_slug":"pathplanner-pathfinding-to-different-positions-with-the-same-button","display_username":"","primary_group_name":null,"flair_name":null,"flair_url":null,"flair_bg_color":null,"flair_color":null,"flair_group_id":null,"badges_granted":[],"version":1,"can_edit":false,"can_delete":false,"can_recover":false,"can_see_hidden_post":true,"can_wiki":false,"read":true,"user_title":null,"bookmarked":false,"actions_summary":[],"moderator":false,"admin":false,"staff":false,"user_id":71857,"hidden":false,"trust_level":2,"deleted_at":null,"user_deleted":false,"edit_reason":null,"can_view_edit_history":true,"wiki":false,"user_custom_fields":{"user_field_4":"Vigilante"},"post_url":"/t/pathplanner-pathfinding-to-different-positions-with-the-same-button/494127/2","custom_user_title":"Vigilante","reactions":[],"current_user_reaction":null,"reaction_users_count":0,"current_user_used_main_reaction":false,"can_accept_answer":false,"can_unaccept_answer":false,"accepted_answer":false,"topic_accepted_answer":null},{"id":3546986,"name":"Martin Nemaric","username":"Martini159","avatar_template":"/letter_avatar_proxy/v4/letter/m/278dde/{size}.png","created_at":"2025-03-04T05:02:18.699Z","cooked":"<p>I would add the following code to your drivetrain subsystem</p>
<pre><code class="lang-auto">public Command pathfindToPose (Supplier&lt;Pose2d&gt; _pose) {
    return new DeferredCommand(
        () -&gt; AutoBuilder.pathfindToPose(_pose.get(), AutoConstants.constraints),
        Set.of(this)
    );
}
</code></pre>
<p>And then change your binding to this</p>
<pre><code class="lang-auto">new JoystickButton(Joystick1, OIConstants.kCollectCoralLeftButtonIdx)
    .whileTrue(drivetrain.pathfindToPose(() -&gt; getCollectPose()))
</code></pre>
<p>Where  <code>drivetrain</code>  is whatever you’ve named your subsystem.</p>
